3 yrs probation w/h;
300 days DCJ w/h&t comm forthwith;
AODA and follow through;
VIP w/in 120 days;
$1200 f + c;
$26 Blood Draw Fee - BDCH;
DNA sample & surcharge;
Driver Improvement surcharge;
Absolute Sobriety;
No Bars/Taverns/Liquor Stores etc;
